// pages/CartPage.js
import React from 'react';

const CartPage = () => {
  return (
    <div>
      <h1>Shopping Cart</h1>
      <p>Review your selected courses and proceed to checkout.</p>
      {/* 购物车列表和结账选项可以在这里展示 */}
    </div>
  );
};

export default CartPage;
